import React, { useEffect, useState } from "react";
import { FixedSizeList, ListChildComponentProps } from 'react-window';
import { useAppDispatch, useAppSelector } from "../../../../redux/hooks";
import { fetchUsersListAsync } from "./userSlice";
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import CircularProgress from '@mui/material/CircularProgress';

const UsersList: React.FC<{ }> = () => {

  const dispatch = useAppDispatch();

  async function getUsersList() {
    dispatch(fetchUsersListAsync());
  }

  const { users, loading } = useAppSelector(
    (state) => state.user
  );

  useEffect(() => {
    getUsersList()
  },[])

  console.log("====", users)
  return (
    <List 
      sx={{
        width: '100%',
        maxWidth: 400,
        bgcolor: 'background.paper',
        position: 'relative',
        overflow: 'auto',
        maxHeight: '40rem'
      }}
    >
      {
        loading ? (<CircularProgress />) : users && users.length > 0 ? (
            <>
              {[...users].map((user: any, index: number) => (
                <ListItem>
                  <ListItemAvatar>
                    <Avatar>
                    </Avatar>
                  </ListItemAvatar>
                  <ListItemText primary={user.username} secondary={user.email} />
                </ListItem>
              ))}
            </>
          ) 
         : (
          <div className="my-5 flex flex-col justify-start px-3">
            <label className="font-weight-light text-gray-regular">
              No Data
            </label>
          </div>
        )
      }
    </List>
  );
};

export default UsersList;
